import React, {useState} from 'react'
import Axios from 'axios'

//obtain TypeScript typings for intellisense
const axios = require('axios').default;

export default function CardDisplay() {

    //information about the cards will be stored here
    const cards = [
        {
            card_id: "MD-1230",
            name: "Titan GFX 20"
        } 
    ]

    axios.get("http://127.0.0.1:8000/api/graphicsCards/model_1/")
    .then(function (response){
        console.log(response);
    })
    .catch(function (error){
        console.log(error);
    })
    

    return ( 
    
        <div className="level">

            <div className="level-left">

                <div className="level-item has-text-centered">
                    <div className="box">
                        <figure className="image is-128x128">    
                            <img src="/gcard.jpg" alt=""/>
                        </figure>
                    </div>
                </div>
            </div>

            <div class="level-item">
                <div className="box">
                    <div className="content">
                        <p class="heading">
                            <strong>MSI Gaming GeForce GT 710 1GB GDRR3 64-bit HDCP Support DirectX 12 OpenGL 4.5 Heat Sink Low Profile Graphics Card (GT 710 1GD3H LPV1) </strong>
                        </p>
                        <p class="heading">
                            Card Specs:
                        </p>
                        <ul>
                            <li>Manufacturer: </li>
                            <li>Memory Clock: </li>
                            <li>Memory Size: </li>
                            <li>Memory Type: </li>
                        </ul>
                    </div>
                </div>
            </div>

        </div>
    )
}
